import "./style.css";
export const NavBar = () => {
  const renderNavList = ({ link }) => <a href=""></a>;
  return (
    <nav>
      <div>
        <img
          className="web-logo-nav"
          src="https://www.starz.com/assets/images/icons/starz-logo-glint.svg"
          alt="web-logo"
        />
      </div>
    </nav>
  );
};
export default NavBar;
